import React from 'react';
import MainLayout from '../components/MainLayout';

function Home() {
  return (
    <MainLayout>
      <div>
        <h1>Bienvenido a Nuestra Aplicación</h1>
        <p>Esta es la página principal.</p>
      </div>
    </MainLayout>
  );
}

export default Home;
